import React from 'react';
import './App.css';
import Homepage from './Homepage';
import Contact from './Contact';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <div></div>
      </Routes>
    </Router>
  );
}

export default App;
